Personalized browser start page based on widgets, wallpapers, and bookmark navigation
Main functions:
Small components: personalized and customized exclusive components;
High definition wallpaper: massive high-definition wallpaper, one click switching;
Navigation bookmarks: can quickly add navigation bookmarks, customize navigation bookmarks, DIY bookmark icons, etc;
Search box: The transparency, prompt words, and font color of the search window can be customized;
It is an extension plugin for setting exclusive custom browsers;
